import React, { Component } from "react";
import { Button, Popover } from "@material-ui/core";
import MoreVertOutlinedIcon from "@material-ui/icons/MoreVertOutlined";

export class Showmoreoption extends Component {
  render() {
    return (
      <div>
        <MoreVertOutlinedIcon  onClick />

        <Popover
          anchorReference="anchorPosition"
          anchorPosition={{ top: 259, left: 700 }}
          anchorOrigin={{
            vertical: "top",
            horizontal: "left"
          }}
          transformOrigin={{
            vertical: "top",
            horizontal: "left"
          }}
        >
          <div>
            <span>
              <Button>Delete note</Button>
            </span>
            <span>
              <Button>Add label</Button>
            </span>
            <span>
              <Button>Add drawing</Button>
            </span>
            <span>
              <Button>show checkboxes </Button>
            </span>
          </div>
        </Popover>
      </div>
    );
  }
}

export default Showmoreoption;
